import "./footer.css";

const Footer = () => {
  return (
    <div className="footer">
      <footer>
        <h2>All Footer Information Here</h2>
        <div className="aside">
          <p>
            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Mollitia a
            quasi beatae odio autem tenetur repellat, neque dolore ab ex
            corrupti sapiente quam aperiam enim dignissimos optio voluptates,
            quia quisquam?
          </p>
        </div>
        <div className="contact">
          <p>phone</p>
          <p>email</p>
          <p>address</p>
        </div>
      </footer>
    </div>
  );
};

export default Footer;
